        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kda9s-0ebf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_2.text.1', 'Ta usługa jest dostępna tylko dla użytkowników w %country%. Aby skorzystać z tej usługi, musisz mieć pozwolenie operatora.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-a9sf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_3.title.1', 'Opis usługi')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0a9s-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_3.title.1.1', '3.a/ Subskrypcja')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-a9s8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_3.text.1', 'Niniejsza usługa subskrypcji umożliwia oglądanie nieograniczonej liczby filmów o sporcie na telefonie użytkownika, które znajdują się w katalogu 100% Sport w cenie %price% %currency% (+ opłata za połączenie WAP). Dopóki użytkownik ma subskrypcję 100% Sport, w każdym tygodniu będzie mieć dostęp do nieograniczonej zawartości.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-4a9s-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_3.text.2', 'Aby zamówić subskrypcję i uzyskać dostęp do filmów i gier, należy kliknąć przycisk subskrypcji w witrynie internetowej 100% Sport. Gdy subskrypcja zostanie potwierdzona, użytkownik zostanie przekierowany na naszą stronę główną i będzie mógł cieszyć się nieograniczonym dostępem do filmów o sporcie i gier z katalogu 100% Sport.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-a9s0-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_3.text.3', 'Tygodniowa subskrypcja użytkownika zostanie automatycznie odnowiona, chyba że użytkownik anuluje subskrypcję. Użytkownik może anulować subskrypcję w dowolnej chwili poprzez osobiste menu, klikając łącze Opuść 100% Sport. 100% Sport zastrzega sobie prawo do zakończenia subskrypcji w dowolnym momencie.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9a9s-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_4.title.1', 'Pomoc i obsługa techniczna')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-a9s8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_4.text.1', 'Kontakt z nami')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sa9ss7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_5.title.1', 'Płatności')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-ska9s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_5.text.2', 'Całkowity koszt subskrypcji będzie podany na każdej stronie, na której użytkownik może się zarejestrować do usługi 100% Sport. Całkowite lub częściowe kwoty zakontraktowanej usługi będą naliczane każdego tygodnia lub w dniu określonym przez operatora komórkowego użytkownika. Niemniej jednak maksymalna cena subskrypcji będzie wynosić %price% %currency% w %period%.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-s1sa9sd3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_5.text.3', 'W przypadku użytkowników korzystających z odroczonej płatności, koszt zostanie dodany do rachunku telefonicznego. Użytkownicy korzystający z przedpłat, powinni upewnić się, że mają odpowiednie środki kredytowe na karcie przedpłatowej do zrealizowania subskrypcji i/lub zakupu.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sks8a9s3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_5.text.1', 'Opłaty mogą się różnić w zależności od operatora komórkowego. Dokładna cena zostanie podana wraz z warunkami usługi przed rozpoczęciem subskrypcji lub dokonaniem zakupu.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sks8sa9sj49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_5.text.4', 'Uzyskiwanie dostępu do witryny internetowej 100% Sport poprzez sieć komórkową 3G lub 4G może spowodować naliczenie dodatkowych opłat. Ich wysokość będzie zależna od stawki i warunków umowy z operatorem komórkowym użytkownika, więc nie można uznać 100% Sport za stronę odpowiedzialną za powstanie takich kosztów.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sks8s7a9s49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_6.title.1', 'Dostęp do usługi')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sks8s7da9s9f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_6.text.1', 'Dostęp do usługi mogą mieć wyłącznie osoby prawne i pełnoprawni nieletni (w wieku powyżej 14 lat), którzy mogą zawierać umowy na usługi 100% Sport. Niepełnoprawni małoletni mogą używać usług 100% Sport tylko na podstawie zgody rodziców lub ich prawnych opiekunów, którzy będą każdorazowo odpowiedzialni za czyny swoich podopiecznych. 100% Sport nie może zastąpić w żadnym zakresie kontroli rodzicielskiej, więc właściciel numeru telefonu komórkowego będzie uznawany za osobę odpowiedzialną za wszelkie powstałe skutki.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sks8s7d3a9sf', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_6.text.2', 'Użytkownik musi mieć wszystkie niezbędne zasoby (urządzenie, oprogramowanie, połączenie z Internetem), by korzystać z usług 100% Sport. 100% Sport może zrezygnować z oferowania usług podczas prowadzenia prac naprawczych, konserwacji i wprowadzania poprawek. 100% Sport może również modyfikować czasowo lub stale określone usługi lub produkty.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sks8s7d3ja9s', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_7.title.1', 'Odpowiedzialność użytkownika')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('z9pkd9d7-0ebf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_7.text.1', '100% Sport nie ponosi odpowiedzialności za jakiekolwiek straty lub obrażenia wynikające z niewłaściwego korzystania z usług świadczonych przez 100% Sport, będących poza kontrolą 100% Sport lub powstałych z przyczyn niezależnych od 100% Sport. Wymaga się nie nadużywania usług 100% Sport i poszanowania praw stron trzecich, w tym praw do znaków towarowych, patentów, praw autorskich oraz innych praw własności intelektualnej i przemysłowej.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('dz9pd9d7-0ebf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_7.text.2', 'Analogicznie, użytkownik rozumie i zgadza się, że korzystanie z usług 100% Sport w celach handlowych i wszelkich innych niepowiązanych celach opisanych w niniejszych Zasadach i warunkach jest niedozwolone.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('duz9p9d7-0ebf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_8.title.1', 'Odpowiedzialność 100% Sport')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4z9pd7-0ebf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_8.text.1', '100% Sport nie ponosi odpowiedzialności za dostępność techniczną lub zawartość sieci Web / Wap / mobilnej witryn internetowych stron trzecich, do których można uzyskać dostęp poprzez łącze zamieszczone w jej witrynie. Dlatego 100% Sport nie zatwierdza ani nie reklamuje produktów, usług, treści, informacji, danych, plików i wszelkiego rodzaju materiałów wyświetlanych w witrynach internetowych stron trzecich. Ponadto 100% Sport nie kontroluje jakości, legalności, rzetelności i celowości treści i usług powiązanych witryn zewnętrznych niespokrewnionych z 100% Sport ani nie odpowiada za nie.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kz9p7-0ebf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_8.text.2', '100% Sport nie ponosi odpowiedzialności za produkty lub usługi, które nie zostaną dostarczone lub wykonane prawidłowo, gdy dany problem nie może zostać przypisany do 100% Sport (w tym, lecz niewyłącznie, np. gdy film użytkownika nie może zostać wczytany ze względu na problemy z łącznością operatora lub kwestie techniczne związane z konfiguracją telefonu użytkownika).')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kdz9p-0ebf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_8.text.3', 'W przypadku zauważenia jakichkolwiek niedozwolonych treści, prosimy o natychmiastowy kontakt.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-z9pf-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_9.title.1', 'Prawa własności intelektualnej i przemysłowej')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0z9p-43d8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_9.text.1', 'Wszelkie treści, gry, projekty i kody programowania zawarte na mobilnym portalu 100% Sport są w pełni chronione prawem autorskim: powielanie, rozpowszechnianie i rozprowadzanie jakiegokolwiek elementu jest całkowicie zabronione, chyba że użytkownik posiada niezbędne zezwolenia.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-z9p8-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_9.text.2', 'Dodatkowo, wszystkie symbole (logo, czcionki, ikony, itp.) widoczne w witrynie 100% Sport są własnością 100% Sport lub stron trzecich, ich powielanie lub rozpowszechnianie bez wyraźnej zgody jest całkowicie zabronione. Zabronione jest również kopiowanie, powielanie lub używanie wszystkich lub części niniejszych Zasad i warunków bez zgody 100% Sport.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-4z9p-9730-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_9.text.3', '100% Sport zastrzega sobie prawo do jednostronnego usuwania, dodawania lub modyfikowania dowolnych treści, usług lub programów narzędziowych dostępnych w mobilnej witrynie internetowej 100% Sport.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-z9p0-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_10.title.1', 'Dane osobiste')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9z9p-sks8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_10.text.1', 'Zgodnie z postanowieniami Ustawy o ochronie danych osobowych z 1998 roku, użytkownik ma prawo dostępu, poprawiania i/lub sprzeciwienia się używania danych osobistych, pisząc do administratora danych firmy ORIGINDATA Ltd, na adres: 3rd Floor, 207 Regent Street, London W1B 3HH, Wielka Brytania.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-z9p8s7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_11.title.1', 'Zmiany')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sz9ps7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_11.text.1', '100% Sport zastrzega sobie prawo do modyfikacji niniejszych Zasad i warunków, w tym cen i wszelkich innych elementów związanych z subskrypcją.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-skz9p7d3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_12.title.1', 'Informacje o firmie')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sks8z9p3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'terms.block_12.text.1', 'Nazwa: ORIGINDATA Ltd <br/> Adres: 3rd Floor, 207 Regent street, London W1B 3HH, Wielka Brytania. <br/> Numer VAT: GB 250 2427 42 <br/> Numer rejestracji firmy: 10294628')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-z6q8z9p3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'contact_us.title', 'Kontakt')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-sz6qz9p3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'contact_us.text.1', 'Czy masz jakieś pytania dotyczące sklepu 100% Sport? Udzielimy Ci dokładnych odpowiedzi! Skontaktuj się z nami za pomocą poniższego formularza kontaktowego')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-skz6q9p3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'contact_us.text.2', 'Skontaktuj się z nami za pomocą naszego formularza kontaktowego poniżej')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('du4kd9d7-0ebf-43d8-9730-s1sz6qp3j49f', '5179fd32-ebd4-11e8-95c4-02bb250f0f22', 'contact_us.field.email', 'Adres e-mail')");
